Comes with 2- 10-shot magazines, manual, training target and tools to adjust the front sight and lock the trigger in place. 
The safety devices on the M22 pistol are:
*  Hammer drop-down which also blocks hammer from firing pin;
*  Loaded chamber indicator at rear of block;
*  External key-lock to lock trigger in a no-shoot position;
*  Trigger safety tab that keeps trigger from being pulled unless trigger finger is securely around the entire piece.
*  Magazine disconnect which does not allow gun to be fired unless a magazine is inserted into the grip.
